		"text": "엉덩이는 작지만 탄력있어 보이고 가슴은 두툼하진 않아서 꽉 쥐어도 별 거 없을 것 같고 이런 생각만 잔뜩 들겠지. \n그러다 어느날 길에서 가족행사 간다고 몸에 잘 붙는 티에 슬랙스, 자켓까지 빼입은 연예인마냥 잘빠진 정대만을 보게 되고..그 순간 저 걸친거 다 벗기고싶다고 떠올리는 송태섭.."
